watch 合并策略监视器不能覆盖，因此将它们合并到数组中。strats.watch = function (parentVal: ?Object, childVal: ?Object): ?Object {
  // 无子级
  if (!childVal) return parentVal
  // 有子级无父级
  if (!parentVal) return childVal
  // 有子级 有父级
  const ret = {}
  extend(ret, parentVal)
  for (const key in childVal) {
    let parent = ret[key]
    const child = childVal[key]
    if (parent && !Array.isArray(parent)) {
      parent = [parent]
    }
    ret[key] = parent
      ? parent.concat(child)
      : [child]
  }
  return ret
}

