  key: string,
  propOptions: Object,
  propsData: ?Object,
  vm?: Component
): any {
  /* istanbul ignore if */
  if (!propsData) return
  const prop = propOptions[key]
  // 缺席，属性未赋值
  const absent = !hasOwn(propsData, key)
  let value = propsData[key]
