      // 赋值了 || 有默认值 && （值为空 || 值与属性转化为连字符形式的字符串相等）
      value = true
    }
  }
  // 检验默认值
  if (value === undefined) {
    // 没有默认值 🔽🔽🔽
    value = getPropDefaultValue(vm, prop, key)
    // 由于默认值是新的拷贝，需要添加观察
