  constructor (
    tag?: string,        // 标签名
    data?: VNodeData,
    children?: Array | void,
    text?: string,
    elm?: Node,
    ns?: string | void,  // 命名空间
    context?: Component, // 在这个组件的作用于下渲染
    componentOptions?: VNodeComponentOptions // 虚拟节点是组件的判断依据
